import React from "react";

import TableOfPromises from "../components/TableOfPromises.js";
import TokenAddressInput from "../components/TokenAddressInput.js";

export default function FindPromise(props) {
  return (
    <div>
      <TokenAddressInput />
      <TableOfPromises joinablePromises={props.joinablePromises} />
    </div>
  );
}
